import React from 'react';
import ReactDOM from 'react-dom';
import * as heading from './header';
import * as cardbox from './cardbox';



import './css/style.css'

const App = () => {
	return (
		<div>
			{heading.header()}
			<div class="container">
				<div class="row">
					<div class="col-9">
						{cardbox.nav}
					</div>
					<div class="col-3"></div>
				</div>
			</div>
		</div>
	)
};



ReactDOM.render(
	<App />,
	document.querySelector('#root')
);
